import React, { Component } from 'react';
import './App.css';
import Topics from './components/Api/google-trend.js'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      greeting: ''
    };

  }

 componentDidMount(){
   Topics();
 }

  render() {
    return (
      <div className="App">
        <header className="App-header">

          <p>{this.state.greeting}</p>


        </header>
      </div>
    );
  }
}

export default App;
